import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const ViagemForm = () => {
  const [origem, setOrigem] = useState('');
  const [destino, setDestino] = useState('');
  const [dataPartida, setDataPartida] = useState('');
  const [numPassageiros, setNumPassageiros] = useState(1);
  const [tipoViagem, setTipoViagem] = useState('idaVolta');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Lógica para lidar com os dados do formulário, por exemplo, enviar para o servidor.
    console.log('Origem:', origem);
    console.log('Destino:', destino);
    console.log('Data de Partida:', dataPartida);
    console.log('Número de Passageiros:', numPassageiros);
    console.log('Tipo de Viagem:', tipoViagem);
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="mb-3">
        <label htmlFor="origem" className="form-label">
          Origem:
        </label>
        <input
          type="text"
          className="form-control"
          id="origem"
          value={origem}
          onChange={(e) => setOrigem(e.target.value)}
          required
        />
      </div>
      <div className="mb-3">
        <label htmlFor="destino" className="form-label">
          Destino:
        </label>
        <input
          type="text"
          className="form-control"
          id="destino"
          value={destino}
          onChange={(e) => setDestino(e.target.value)}
          required
        />
      </div>
      <div className="mb-3">
        <label htmlFor="dataPartida" className="form-label">
          Data de Partida:
        </label>
        <input
          type="date"
          className="form-control"
          id="dataPartida"
          value={dataPartida}
          onChange={(e) => setDataPartida(e.target.value)}
          required
        />
      </div>
      <div className="mb-3">
        <label htmlFor="numPassageiros" className="form-label">
          Número de Passageiros:
        </label>
        <input
          type="number"
          className="form-control"
          id="numPassageiros"
          value={numPassageiros}
          onChange={(e) => setNumPassageiros(e.target.value)}
          min="1"
          required
        />
      </div>
      <div className="mb-3">
        <label className="form-label">Tipo de Viagem:</label>
        <div className="form-check">
          <input
            type="radio"
            className="form-check-input"
            id="idaVolta"
            value="idaVolta"
            checked={tipoViagem === 'idaVolta'}
            onChange={() => setTipoViagem('idaVolta')}
          />
          <label className="form-check-label" htmlFor="idaVolta">
            Ida e Volta
          </label>
        </div>
        <div className="form-check">
          <input
            type="radio"
            className="form-check-input"
            id="somenteIda"
            value="somenteIda"
            checked={tipoViagem === 'somenteIda'}
            onChange={() => setTipoViagem('somenteIda')}
          />
          <label className="form-check-label" htmlFor="somenteIda">
            Somente Ida
          </label>
        </div>
      </div>
      <button type="submit" className="btn btn-primary">
        Buscar Viagem
      </button>
    </form>
  );
};

export default ViagemForm;
